import { useState } from "react";
import { Range, getTrackBackground } from "react-range";
function Pace() {
    const STEP = 0.1;
    const MIN = 0;
    const MAX = 100;
    const [pace, setPace] = useState(1)

render
  return (
    <div>
        {pace}
        <Range
            values={this.pace.values}
            step={STEP}
            min={MIN}
            max={MAX}
            onChange={(values=>this.setPace({values}))}/>



        </div>
  )
}
export default Pace
